using namespace std;

template<class T, class S>
ostream& operator<<(ostream& os, const unordered_map<T, S>& v)
{
	bool f = true;
	os << "{";
    for (auto& t: v) {
    	if (f) os << "(" << t.first << "," << t.second << ")";
    	else os << "," << "(" << t.first << "," << t.second << ")";
    }
    return os << "}";
}

template <class T>
ostream& operator<<(ostream& os, const vector<T>& vs)
{
	os << "[";
    for (auto& s: vs) {
        os << s << " ";
    }
    return os <<"]";
}


class Solution {
public:
    vector<vector<bool>> used;

    bool search(vector<vector<char> > &board, int i, int j, string& word, int k) {
        if (word.size() == k) return true;        
        if (used[i][j] || board[i][j] != word[k]) return false;

        used[i][j] = true;
        if (j < board[0].size() - 1 && search(board, i, j+1, word, k+1)) return true;
        if (j >= 1 && search(board, i, j-1, word, k+1)) return true;
        if (i < board.size() - 1 && search(board, i+1, j, word, k+1)) return true;
        if (i >= 1 && search(board, i-1, j, word, k+1)) return true;
        if (word.size() == k+1) return true;
        used[i][j] = false;        
        return false;
    }

    bool exist(vector<vector<char> > &board, string word) {
        if (!board.size() || !board[0].size() || !word.size()) return false;
        int n = board.size(), m = board[0].size();

        used = vector<vector<bool>>(n, vector<bool>(m, false));
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                if (board[i][j] == word[0] && search(board, i, j, word, 0))
                    return true;
            }
        }

        return false;
    }
};

void test(vector<vector<char> > &board, string word) {
	cout << Solution().exist(board, word) << endl;
}

